cy.fixture("registry/routes.admin.json").then(function (cfg) {
    var baseUrl = Cypress.env(cfg.baseUrlEnv);
    expect(baseUrl).to.exist;
    cfg.routes.forEach(function (r) {
        cy.visitRoute(cfg.baseUrlEnv, r.path);
        if (r.auth && r.auth !== "guest" && r.auth !== "any") {
            cy.assertRedirectToLogin();
        }
        else {
            cy.assertNoAppCrash();
        }
    });
});
